import "./Main.css";
import { CheckList } from "../components/CheckList";
import { Note } from "../components/Note";
import { useState } from "react";
import { useNavigate } from 'react-router-dom';

export const Main = () => {
  const [kind, setKind] = useState("");
    const navigate = useNavigate();
  return (
    <div className="mainContainer">
      <div className="logoutBox">
        <button className="logoutButton" onClick={()=> navigate("/login")}>Logout</button>
      </div>
      <div
        style={{ fontSize: "1.5rem", fontWeight: "600" }}
        onClick={() => setKind("")}
      >
        React 교실
      </div>
      <div className="mainTopButtonBox">
        <button className="mainTopButtons" onClick={() => setKind("first")}>
          Todos
        </button>
        <button className="mainTopButtons" onClick={() => setKind("second")}>
          Note
        </button>
        <button className="mainTopButtons" onClick={() => setKind("third")}>
          Temp
        </button>
      </div>
      <div className="mainContent">
        {kind === "first" ? (
          <CheckList />
        ) : kind === "second" ? (
          <Note />
        ) : kind === "third" ? (
          <div>third component</div>
        ) : (
          <div>HR-PROJECT</div>
        )}
      </div>
    </div>
  );
};
